import {Link} from 'react-router-dom'

const TeamCard = props => {
  const {eachTeam} = props
  const {id, name, teamImageUrl} = eachTeam
  return (
    <div className="teamCard-pro">
      <img src={teamImageUrl} alt="name" className="teamCardImage-pro" />
      <h1 className="teamHeading">{name}</h1>
    </div>
  )
}

